    return (
        <>
        {
            props.text === "Resume" ? 
                <div className="ratio ratio-16x9">
                    <iframe title="resume" src="https://docs.google.com/document/d/e/2PACX-1vRyuOne0BEqw9bBVM1u90TsFwq9HhXXBaW6-0XYvaLbkvgRQP5vMqDAdPSV0IxmjA/pub?embedded=true"></iframe>                
                </div>
                :
                <About pic={props.pic} text={props.text} />
        }
        </>
    )
}

export default Content
